function SelectGender({control} : any) {
    return (
        <div className='w-[100px] h-[30px] border ml-6 rounded-xl'>
            <div className='w-full flex items-center justify-center'>
                <button className='basis-1/2 h-full'>
                    남자
                </button>
                <button className='basis-1/2 h-full'>
                    여자
                </button>
            </div>
        </div>
    )
}
export default SelectGender;
